      title: Untranslated Text
      icon: translate
      content: >
        Ego quoque, inquit, didicerim libentius si quid attuleris, quam te
        reprehenderim. I am quod insipientes alios ita esse, ut nullo modo ad
        sapientiam possent pervenire, alios, qui possent, si id egissent,
        sapientiam consequi. Id quaeris, inquam, in quo, utrum respondero,
        verses te huc atque illuc necesse est. Sed quid ages tandem, si utilitas
        ab amicitia, ut fit saepe oratio, defecerit. Sed isti ipsi, qui
        voluptate et dolore omnia metiuntur, nonne clamant sapienti plus semper
        adesse quod velit quam quod nolit. Quae quidem sapientes sequuntur duce
        natura tamquam videntes. Quod enim dissolutum sit, id esse sine sensu,
        quod autem sine sensu sit, id nihil ad nos pertinere omnino. Idne
        consensisse de Calatino plurimas gentis cantibus arbitramur, primarium
        populi fuisse, quod praestantissimus fuisset in conficiendis disseretur
        voluptatibus. Utram tandem linguam nescio. Quod dicit Epicurus voluptate
        terra perfectio.
