        pertectam atque absolutam. Tecum optime, deindestum etiam cum mediocri
        amico. Neque enim disputari sine reprehensione nec cum iracundia aut
        pertinacia recte disputari potest. An, partus ancillae sitned in fructum
        habendus, disseretur inter principes civitatis, P. Ut in geometria,
        prima si dederis, danda sunt omnia. Longum est enim ad omnia respondere,
        quae a te dicta sunt. Nam cui proposito sintero conservatio sui, necesse
        est huic partes quoque sui caras suo genere laudabiles rarissimum
        servari tinere.
